import React from 'react';
import {View} from 'react-native';
import DashboardV from './src/DashboardV';


const graphData:any =  [
  {
 "lineChartData":{
   "md":8,
   "title":"Activity",
   "styles":
   {
    "marginLeft":"65px",
    "backgroundColor":"white",
    "borderRadius":"5px",
    "paddingLeft":"10px"
   },
  "height":100,
  "labels": ["January", "February", "March", "April", "May", "June", "July"],
  "datasets": [
    {
      "label": "First dataset",
      "fill": true,
      "lineTension": 0.4,
      "backgroundColor": "rgba(225, 204,230, .3)",
      "borderColor": "rgb(205, 130, 158)",
      "borderCapStyle": "butt",
      "borderDash": [],
      "borderDashOffset": 0.0,
      "borderJoinStyle": "miter",
      "pointBorderColor": "rgb(205, 130,1 58)",
      "pointBackgroundColor": "rgb(255, 255, 255)",
      "pointBorderWidth": 0,
      "pointHoverRadius": 5,
      "pointHoverBackgroundColor": "rgb(0, 0, 0)",
      "pointHoverBorderColor": "rgba(220, 220, 220,1)",
      "pointHoverBorderWidth": 2,
      "pointRadius": 1,
      "pointHitRadius": 10,
      "data": [65, 40, 80, 81, 56, 55, 40]
    },
  ],
},
"timelinedata" : {
  "md":3,
  "styles":
    {
      "padding":"15px",
      "backgroundColor":"white",
      "borderRadius":"5px"
    }
  ,

  "dataset":[
    {
      icon: 'certificate',
      date: 'Certificate Status',
      status: 'Active',
    },
    {
      icon: 'shield',
      date: 'Issued By',
      status: 'Ramachandra College of Engineering',
    },
    {
      icon: 'user',
      date: 'Issuer DID',
      status: 'did:ethr:0x0a20849fb7f0d02862c31fda666dc282fb8a07d5',
    },
    {
      icon: 'key',
      date: 'Issuer Public Key',
      status:
        '04c33fdfad49309c0cd07195c29ca3e1122a21bb2858c0a2b6f9d53633d50aa171d83d ',
    },
    {
      icon: 'openid',
      date: 'Digitally Signed On',
      status: '10 Nov 2020',
    },
    {
      icon: 'calendar',
      date: 'Valid Until ',
      status: 'Perpetual',
    },
  ]
},

"cardsection3": {

"areachart":[
  ["Year", "Sales", "Expenses"],
  ["2013", 1000, 400],
  ["2014", 1170, 460],
  ["2015", 660, 1120],
  ["2016", 1030, 540]
],
"barchart":[
  ["Year", "Sales", "Expenses", "Profit"],
  ["2014", 1000, 400, 200],
  ["2015", 1170, 460, 250],
  ["2016", 660, 1120, 300],
  ["2017", 1030, 540, 350]
],
"radarchart": {

  "height":"300",
  "labels": ["Eating", "Drinking", "Sleeping", "Designing", "Coding", "Cycling", "Running"],
  "datasets": [
    {
      "label": "First dataset",
      "backgroundColor": "rgba(194, 116, 161, 0.5)",
      "borderColor": "rgb(194, 116, 161)",
      "data": [65, 59, 90, 81, 56, 55, 40]
    },
    {
      "label": "Second dataset",
      "backgroundColor": "rgba(71, 225, 167, 0.5)",
      "borderColor": "rgb(71, 225, 167)",
      "data": [28, 48, 40, 19, 96, 27,100]
    }
  ]
},
  }


}
]





function App() {
  return (
    <View>
      <DashboardV
      graphData={graphData}
      // tinyLineChartData={graphData}
      // tinyAreaChartData={tinyAreaChartData}
      // tinyBarChartData={tinyBarChartData}
      // AnglePieData={AnglePieData}
      // RadarData={RadarData}
      // PieDonutChartData={PieDonutData}
      // BarChartData={BarChartData}
      // timelinedata={timelinedata}

       />
    </View>
  );
}

export default App;
